pii_cleaned_message:
Hi [PERSON_NAME]! Good to hear from you. Below is the typical process:

1. Client sends me any outdated resumes, as well as a brief explanation of their immediate career goal (i.e. change in career, career advancement, new company, etc.);
2. I collect additional info via a digital survey, phone call, or email (your choice, although in my experience the digital survey is the most thorough and efficient option);
3. I review all collected information and send any follow-up questions via email, if necessary;
4. Within 1 business day of receiving your answers to those questions, you'll receive a new resume and cover letter!

My rate includes a &quoteBest Practices in Resume and Cover Letter Writing&quote tip sheet and one round of revisions within a week after you received the final documents. 

The process as a whole typically takes less than one week. I require payment in advance, either by Venmo or PayPal (both offer great consumer protection).

Let me know if you have any additional questions, or would like to schedule a quick phone consultation!

Best,
[PERSON_NAME]
